import { BrowserRouter, Route, Routes } from 'react-router-dom';
import React from 'react';
import img_logo from "./img/logo.png";
import './Home.css';



const Home = () => {
    return (    
    <BrowserRouter>
        <div className="Home">
            <header className='Home-header'>            
                < img src={img_logo} className="Home-image"/>                    
            </header>
        <Routes>
            <Route path="/" element={<Home />} />        
        </Routes> 
        </div>
    </BrowserRouter>
    );
};

export default Home;
